import Head from 'next/head';

const Layout = (props) => {
    return (
        <div>
            <Head>
                <title>Got Plants Tonight?</title>
                <link 
                rel="stylesheet"
                href="https://bootswatch.com/4/minty/bootstrap.min.css"
                />
            </Head>
            <div>
                {props.children}
            </div>
        </div>
    )
}

export default Layout;
